import "./main.css";
import firstPhoto from "../assets/main.jpeg";
const Main = () => {
  return (
    <>
      <div className="container">
        <div className="main_inner">
          <div className="main">
            <img src={firstPhoto} alt="photo" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Main;
